he Java platform in Java 5.0 and Java 6. Now this same team provides the best explanation yet of these new features, and of concurrency in general. Concurrency is no longer a subject for advanced users only. Every Java developer should read this book.\"Martin Buchhold.JDK Concurrency Czar, Sun Microsystems.For the past 30 years, computer performance has been driven by Moore\'s Law; from now on, it will be driven by Amdahl\'s Law. Writing code that effectively exploits multiple processors can be very challenging. Java Concurrency in Practice provides you with the concepts and techniques needed to write safe and scalable Java programs for today\'s--and tomorrow\'s--systems.\"Doron Rajwan Research Scientist, Intel Corp.\"This is the book you need if you\'re writing--or designing, or debugging, or maintaining, or contemplating--multithreaded Java programs. If you\'ve ever had to synchronize a method and you weren\'t sure why, you owe it to yourself and your users to read this book, cover to cover.\"</div><div>--Ted Neward</div><div>Author of Effective Enterprise Java</div><div><br></div><div>\"Brian addresses the fundamental issues and complexities of concurrency with uncommon clarity. This book is a must-read for anyone who uses threads and cares about performance.\"</div><div>--Kirk Pepperdine</div><div>CTO, JavaPerformanceTuning.com</div><div><br></div><div>\"This book covers a very deep and subtle topic in a very clear and concise way, making it the perfect Java Concurrency reference manual. Each page is filled with the problems (and solutions!) that programmers struggle with every day. Effectively exploiting concurrency is becoming more and more important now that Moore\'s Law is delivering more cores but not faster cores, and this book will show you how to do it','0321349601',_binary '\\\0JFIF\0\0\0\0\0\0\\0C\0	\Z!\Z\"$\"$\\0C\0\"\0